INSERT INTO `product_product` (`id`, `name`, `description`, `price`) VALUES (1,'Bee Colection Rue Bac 20 Fotos Branco','O Porta-retrato Bee Colection é produzido em vidro, madeira e papel o que o torna altamente resistente e durável.',169.00),(2,'Esteirinha para Braço com Porta Copo 2x22 cm Malaga','Para contribuir com a praticidade do seu dia a dia, a Bianchi Móveis elaborou a Esteirinha para Braço de Sofá com Porta-Copos. Com ela será possível curtir os momentos de lazer ao lado dos amigos e da família, sem se preocupar com possíveis ‘acidentes’ no seu móvel, já que possui espaço específico para colocar copos, mantendo-os seguros e estáticos. ',79.00),(3,'Kit Com 2 Porta-Retratos 1 Foto 15X21 cm Branco 18x24 cm Kapos','Para uma decoração completa e atraente, alguns elementos são indispensáveis. Este kit com 2 porta-retratos é ideal para decorar qualquer ambiente de sua escolha com as suas melhores lembranças.',22.90),(4,'Centro de Mesa Felicia Vermelho 10x35x90cm Luca Millani','Luca Millani elabora as suas peças como verdadeiras obras de arte, ele rompe a barreira do mero enfeite e entra no campo da apreciação e experimentação estética. Explorando formas e cores a fundo, ele criar itens únicos e extremamente originais, como este maravilhoso Centro de Mesa Felícia.',429.00);
